      subroutine setoptical57(itmed)
      implicit none
      integer itmed
      integer nbins
      real Ephot(8)
      real abslen(8)
      real effic(8)
      real rindex(8)
      real smooth(8)
      real refloss(8)
      common /optical57/nbins,Ephot,rindex,abslen,refloss,smooth,effic
      integer i
      data nbins/8/
      data (Ephot(i),i=1,8) /
     + 1.5e-09,2e-09,2.5e-09,3e-09,3.5e-09,4e-09,
     + 4.5e-09,5e-09/
      data (rindex(i),i=1,8) /
     + 1.00133,1.00134,1.00135,1.00137,1.00139,1.00141,
     + 1.00143,1.00146/
      data (abslen(i),i=1,8) /
     + 10000,10000,10000,10000,10000,3000,
     + 2000,150/
      data (smooth(i),i=1,8) /
     + 0,0,0,0,0,0,
     + 0,0/
      data (refloss(i),i=1,8) /
     + 1,1,1,1,1,1,
     + 1,1/
      data (effic(i),i=1,8) /
     + 0,0,0,0,0,0,
     + 0,0/
      call GSCKOV(itmed,nbins,Ephot,abslen,effic,rindex)
      end

      subroutine getoptical57(E,refl,absl,rind,plsh,eff)
      implicit none
      real E,refl,absl,rind,plsh,eff
      integer n
      real x
      integer nbins
      real Ephot(8)
      real abslen(8)
      real effic(8)
      real rindex(8)
      real smooth(8)
      real refloss(8)
      common /optical57/nbins,Ephot,rindex,abslen,refloss,smooth,effic
      do n=1,nbins
        if (E.lt.Ephot(n)) go to 10
      enddo
   10 continue
      if (n.eq.1.or.n.gt.nbins) then
        refl = 0
        absl = 0
        rind = 0
        plsh = 1
        eff = 0
      else
        x = (E-Ephot(n-1))/(Ephot(n)-Ephot(n-1))
        refl = (1-x)*refloss(n-1)+x*refloss(n)
        absl = (1-x)*abslen(n-1)+x*abslen(n)
        rind = (1-x)*rindex(n-1)+x*rindex(n)
        plsh = (1-x)*smooth(n-1)+x*smooth(n)
        eff = (1-x)*effic(n-1)+x*effic(n)
      endif
      end

