      subroutine getoptical60(E,refl,absl,rind,plsh,eff)
      implicit none
      real E,refl,absl,rind,plsh,eff
      integer n
      real x
      integer nbins
      real Ephot(36)
      real abslen(36)
      real effic(36)
      real rindex(36)
      real smooth(36)
      real refloss(36)
      common /optical60/nbins,Ephot,rindex,abslen,refloss,smooth,effic
      do n=1,nbins
        if (E.lt.Ephot(n)) go to 10
      enddo
   10 continue
      if (n.eq.1.or.n.gt.nbins) then
        refl = 0
        absl = 0
        rind = 0
        plsh = 1
        eff = 0
      else
        x = (E-Ephot(n-1))/(Ephot(n)-Ephot(n-1))
        refl = (1-x)*refloss(n-1)+x*refloss(n)
        absl = (1-x)*abslen(n-1)+x*abslen(n)
        rind = (1-x)*rindex(n-1)+x*rindex(n)
        plsh = (1-x)*smooth(n-1)+x*smooth(n)
        eff = (1-x)*effic(n-1)+x*effic(n)
      endif
      end

